import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page first (required for view toggle to appear)
    await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('.category-card:has-text("Electronics")');

    // Wait for view toggle controls to appear
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Take screenshot before switching view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_switch.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_switch.png'));

    // Switch to list view mode
    await page.click('button[title="List View"]');

    // Wait for list view to be activated
    await page.waitForSelector('.view-btn.active[title="List View"]', { timeout: 5000 });

    // Verify list view is active
    const isListViewActive = await page.$eval('.view-btn.active[title="List View"]', 
      btn => btn.classList.contains('active'));

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    return {
      success: true,
      action: "Successfully switched to list view mode",
      extractedData: {
        listViewActive: isListViewActive,
        viewMode: 'list'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
